import React, { useState } from "react";

function HookArray() {
  // const arraytt = [];
  const [todoList, SetTodoList] = useState([]);
  const [title, setTitle] = useState("");

  const handleSubmit = () => {
    SetTodoList([
      ...todoList,
      {
        id: todoList.length,
        title: title,
        value: title,
      },
    ]);
  };

  return (
    <div>
      <input
        type="text"
        onChange={(e) => SetTodoList({ ...todoList, title: e.target.value })}
      />
      <button onClick={handleSubmit}>Add Task</button>
      {todoList.map((todo) => (
        <p key={todo.id}>
          {todo.id}
          {todo.value.title}
          {todo.title.title}
        </p>
      ))}
      {/* <p key={todoList.id}>{todoList.title}</p> */}
    </div>
  );
}

export default HookArray;
